    [],nt"num_tags": 30,nt"name": "land-protection-plan-and-environmental-assessment-for-boundary-expansion-of-plum-tree-isla",nt"isopen":
    false,nt"url": null,nt"notes": "When considering a request to expand the
    boundary of a National Wildlife Refuge, the Fish and Wildlife Service must first
    determine if the natural resources present are nationally significant and if inclusion
    into the Refuge System is justified. Boundary lines cannot be drawn simply to protect
    isolated habitats from development activities. A boundary must be biologically and
    administratively warranted. The purpose of this Environmental Assessment and Land
    Protection Plan is to identify the best method of permanently protecting lands surrounding
    the Plum Tree Island Refuge, and to determine whether acquisition by the Fish and
    Wildlife Service is warranted. Alternatives and options are analyzed and outlined.",nt"owner_org":
